import Modal from "../UI/Modal";
import styles from "./BuyModal.module.scss";

function BuyModal(props) {
  return (
    <Modal close={props.close}>
      <div className={styles.container}>
        <span>
          <p>Participants:</p>
          <input type="number" />
        </span>
        <button>BUY</button>
      </div>
    </Modal>
  );
}

export default BuyModal;
